@dataclass(eq=True, frozen=True)
class RequestDescriptor:
    url: str
    headers: Optional[Mapping[str, str]]
    body: Optional[Mapping[str, Any]]


@dataclass(eq=True, frozen=True)
class ResponseDescriptor:
    status_code: int
    body: Any # FIXME obviously this is not the right type
    headers: Any

